import React from 'react';
import TopTracks from './pages/TopTracks';
import TopArtists from './pages/TopArtists';
import Dashboard from './Dashboard';
import { Link, Routes, Route } from 'react-router-dom';
import './dashboardNavbar.css';

export default function DashboardNavbar({ code }) {
    return (
        <>
            <div className="navigation-bar">
                <Link className="navigation-item" to="/top-tracks">Top Tracks</Link>
                <Link className="navigation-item" to="/top-artists">Top Artists</Link>
                <Link className="navigation-item" to="/">Home</Link>
            </div>
            <Routes>
                <Route path="*" element={<Dashboard code={code} />}></Route>
                <Route path="/top-tracks" element={<TopTracks />}></Route>
                <Route path="/top-artists" element={<TopArtists />}></Route>
            </Routes>
        </>
    )
}
